import React from "react";
import Highcharts, { color } from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import HighChartsMore from "highcharts/highcharts-more";
import item from "highcharts/modules/item-series"
import drilldown from "highcharts/modules/drilldown";
function WebDevChart() {
    drilldown(Highcharts);
     HighChartsMore(Highcharts);
    let options = {
        colors: ['#FFD700', '#C0C0C0', '#CD7F32'],
        chart: {
            type: 'column',
            inverted: true,
            polar: true,
            height:"320px",
            backgroundColor:'transparent'
        },
        tooltip: {
            outside: true
        },
        pane: {
            size: '85%',
            innerSize: '20%',
            endAngle: 270
        },
        xAxis: {
            tickInterval: 1,
            labels: {
            align: 'right',
            useHTML: true,
            allowOverlap: true,
            step: 1,
            y: 3,
            style: {
                fontSize: '13px'
            }
            },
            lineWidth: 0,
            categories: ['JS','CSS','HTML'],
        },
        yAxis: {
          crosshair: {
            enabled: true,
            color: '#333'
          },
          lineWidth: 0,
          tickInterval: 25,
          reversedStacks: false,
          endOnTick: true,
          showLastLabel: true
        },
        plotOptions: {
          column: {
            stacking: 'normal',
            borderWidth: 0,
            pointPadding: 0,
            groupPadding: 0.15
          }
        },
        series: [{
          name: 'HTML5',
          data: [0, 0, 155]
        }, {
          name: 'Bootstrap',
          data: [0, 110, 0]
        }, {
          name: 'Bronze medals',
          data: [111, 90, 0]
        }],
        // title: {
        // style:{color:'white',fontSize:'15px',fontFamily:'cursive'},
        // text: '(Click on each section for more info)'
        // },
        
        credits: {
            enabled:false
          }
    
    }


    return (
        <span>
      <HighchartsReact 
        highcharts={Highcharts}
        options={options}
      />
    </span>
    )
}



export default WebDevChart;
